import { StyleSheet } from "react-native";

export default StyleSheet.create({
    box: {
        display: "flex",
        justifyContent: "space-around",
        flexDirection: "row",
    },
    page: {
        alignItems: 'center',
    },
    btn: {
        margin: 10,
        borderColor: 'black',
        borderWidth: 2,
    },
    input:{
        marginleft: 15,
        borderColor: 'black',
        borderWidth: 2,
    }
})
